import currency
__collection_name = Variable(contract='con_nameservice', name='collection_name'
    )
__collection_owner = Variable(contract='con_nameservice', name=
    'collection_owner')
__collection_nfts = Hash(default_value=False, contract='con_nameservice',
    name='collection_nfts')
__collection_balances = Hash(default_value=0, contract='con_nameservice',
    name='collection_balances')
__collection_balances_approvals = Hash(default_value=0, contract=
    'con_nameservice', name='collection_balances_approvals')
__mint_price = Variable(contract='con_nameservice', name='mint_price')
__royalty_fee_percentage = Variable(contract='con_nameservice', name=
    'royalty_fee_percentage')
__contracts_allowlist = Variable(contract='con_nameservice', name=
    'contracts_allowlist')


def ____(name: str, owner: str):
    __collection_name.set(name)
    __collection_owner.set(owner)
    __contracts_allowlist.set([])
    __mint_price.set(1)
    __royalty_fee_percentage.set(2)


@__export('con_nameservice')
def mint_nft(name: str):
    name = name.lower()
    assert name.isalnum(), 'Name must be alphanumeric'
    assert __collection_nfts[name] == False, 'Name already exists'
    assert len(name) >= 3, 'The minimum length is 3 characters'
    assert len(name) <= 32, 'The maximum length is 32 characters'
    currency.transfer_from(amount=__mint_price.get(), to=__collection_owner
        .get(), main_account=ctx.caller)
    __collection_nfts[name] = {'description':
        'A alias name for your wallet.', 'ipfs_image_url': '', 'metadata':
        {}, 'amount': 1}
    __collection_balances[ctx.caller, name] = 1


@__export('con_nameservice')
def transfer(name: str, amount: int, to: str):
    assert amount > 0, 'You cannot transfer negative amounts'
    assert name != '', 'Please specify the name of the NFT you want to transfer'
    assert __collection_balances[ctx.caller, name
        ] >= amount, "You don't have enough NFTs to send"
    __collection_balances[ctx.caller, name] -= amount
    __collection_balances[to, name] += amount


@__export('con_nameservice')
def approve(amount: int, name: str, to: str):
    assert amount > 0, 'Cannot approve negative amounts'
    __collection_balances_approvals[ctx.caller, to, name] += amount


@__export('con_nameservice')
def transfer_from(name: str, amount: int, to: str, main_account: str):
    if 'con_' in ctx.caller:
        assert ctx.caller in __contracts_allowlist.get(
            ), 'This contract is not allowed to interact with this contract'
    assert amount > 0, 'Cannot send negative balances!'
    assert __collection_balances_approvals[main_account, to, name
        ] >= amount, 'Not enough NFTs approved to send! You have {} and are trying to spend {}'.format(
        __collection_balances_approvals[main_account, to, name], amount)
    assert __collection_balances[main_account, name
        ] >= amount, 'Not enough NFTs to send!'
    __collection_balances_approvals[main_account, to, name] -= amount
    __collection_balances[main_account, name] -= amount
    __collection_balances[to, name] += amount


